//-----------------------------------------------------------------------------
// Compute average over networks. Default is to use all networks
//-----------------------------------------------------------------------------
double hzz2e2mu_noiso(double ele1_pt,
                      double ele1_eta,
                      double ele1_phi,
                      double ele2_pt,
                      double ele2_eta,
                      double ele2_phi,
                      double ele3_pt,
                      double ele3_eta,
                      double ele3_phi,
                      double ele4_pt,
                      double ele4_eta,
                      double ele4_phi,
                      double worst_vertex,
                      double second_worst_vertex,
                      double mZ,
                      double mZstar,
                      double mbestH,
                      int first=0, int last=nshzz2e2mu_noiso::nnetworks-1)
{
  if ( first < 0 ) first = 0;
  if ( last  < 0 ) last  = nshzz2e2mu_noiso::nnetworks-1;
  if ( last  > nshzz2e2mu_noiso::nnetworks-1 ) last = nshzz2e2mu_noiso::nnetworks-1;
  if ( first > last )
    {
      std::cerr << "** hzz2e2mu_noiso ** first-index > last-index"
                << std::endl; exit(3);
    }

  // Compute average over networks
  std::vector<double> in(nshzz2e2mu_noiso::ninputs);
  in[0] = (ele1_pt - nshzz2e2mu_noiso::mean[0]) / nshzz2e2mu_noiso::sigma[0];
  in[1] = (ele1_eta - nshzz2e2mu_noiso::mean[1]) / nshzz2e2mu_noiso::sigma[1];
  in[2] = (ele1_phi - nshzz2e2mu_noiso::mean[2]) / nshzz2e2mu_noiso::sigma[2];
  in[3] = (ele2_pt - nshzz2e2mu_noiso::mean[3]) / nshzz2e2mu_noiso::sigma[3];
  in[4] = (ele2_eta - nshzz2e2mu_noiso::mean[4]) / nshzz2e2mu_noiso::sigma[4];
  in[5] = (ele2_phi - nshzz2e2mu_noiso::mean[5]) / nshzz2e2mu_noiso::sigma[5];
  in[6] = (ele3_pt - nshzz2e2mu_noiso::mean[6]) / nshzz2e2mu_noiso::sigma[6];
  in[7] = (ele3_eta - nshzz2e2mu_noiso::mean[7]) / nshzz2e2mu_noiso::sigma[7];
  in[8] = (ele3_phi - nshzz2e2mu_noiso::mean[8]) / nshzz2e2mu_noiso::sigma[8];
  in[9] = (ele4_pt - nshzz2e2mu_noiso::mean[9]) / nshzz2e2mu_noiso::sigma[9];
  in[10] = (ele4_eta - nshzz2e2mu_noiso::mean[10]) / nshzz2e2mu_noiso::sigma[10];
  in[11] = (ele4_phi - nshzz2e2mu_noiso::mean[11]) / nshzz2e2mu_noiso::sigma[11];
  in[12] = (worst_vertex - nshzz2e2mu_noiso::mean[12]) / nshzz2e2mu_noiso::sigma[12];
  in[13] = (second_worst_vertex - nshzz2e2mu_noiso::mean[13]) / nshzz2e2mu_noiso::sigma[13];
  in[14] = (mZ - nshzz2e2mu_noiso::mean[14]) / nshzz2e2mu_noiso::sigma[14];
  in[15] = (mZstar - nshzz2e2mu_noiso::mean[15]) / nshzz2e2mu_noiso::sigma[15];
  in[16] = (mbestH - nshzz2e2mu_noiso::mean[16]) / nshzz2e2mu_noiso::sigma[16];

  int   n = last - first + 1;
  double x = 0.0;
  for(int i=first; i <= last; i++) x += nshzz2e2mu_noiso::netfun(in, nshzz2e2mu_noiso::weight[i]);
  return x / n;
}

double hzz2e2mu_noiso(std::vector<double>& in,
                      int first=0,
                      int last=nshzz2e2mu_noiso::nnetworks-1)
{
  return hzz2e2mu_noiso(in[0],
                        in[1],
                        in[2],
                        in[3],
                        in[4],
                        in[5],
                        in[6],
                        in[7],
                        in[8],
                        in[9],
                        in[10],
                        in[11],
                        in[12],
                        in[13],
                        in[14],
                        in[15],
                        in[16], first, last);
}

